import React from 'react';
import ReactDOM from 'react-dom/client';
import './App.css';
import App from './App';
import init from './engine/chess_wasm';

const root = ReactDOM.createRoot(document.getElementById('root'));
init();
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);
